<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>filter</title>
</head>
<body>
    <script>
        const numbers = [5,6,7,9,10,34,54,67]
        const filterResult=numbers.filter((num)=>{
            return (num > 10 && num <= 67)
        })
        document.write(`${filterResult}`)
    </script>
</body>
</html>
